import React from 'react';
import '../App.css';
import api from '../api'

const load = async () =>{
    await api.getAllProducts().then(products => {
        this.setState({
            products: products.data,
        })
    })
}
// load();
console.log(this.products);

export const Cups = () => {
    return (
        <div>
            {load()};
            <h1>Test</h1>
        </div>
    )
}
